import Modal from 'react-modal'

export default function ModalOpen() {

const [open, setOpen] = useState(true)


const handleCLick = useCallback(() => {
setOpen(!open)

}, [])





  return (
    <div className='modalMenu'>

<Modal >
<input type = 'text' placeholder='Brand'/>
<input type = 'url' placeholder='Single Image URL'/>
<input type = 'url' placeholder='Images URL'/>
<input type = 'text' placeholder='Product Description'/>
<input type = 'number' placeholder='Price'/>
<input type = 'number' placeholder='Quantity'/>
<input type = 'text' placeholder='Short Description'/>
<input type = 'number' placeholder='Category Number'/>
<button onClick={() => handleCLick()} type = 'submit'>Create Product</button>
</Modal>


    </div>
  )
}
